※<div class="hekimen_haiso"><img src="https://image.rakuten.co.jp/i-office1/cabinet/sk9/hekimen_nennaihaiso.gif" border="0" alt="年内配送"/><br><br></div>
<p class="deliv_fee_hoku">北海道への配送は別途送料がかかります。<br>北海道送料：【北7】タイプ</p><p><img src="https://image.rakuten.co.jp/i-office1/cabinet/cam/dibiki.gif" alt="代金引換不可商品" border="0" ></p><img src="https://image.rakuten.co.jp/i-office1/cabinet/chiba5/life-otodoke.gif" alt=""   border="0" ><br><span class="style2">

<br />
</span> ■商品説明<br />
<table cellpadding="0" cellspacing="5" bgcolor="#ffffff" class="style1" style="border:1px dotted #996666;">
<tr valign="top" align="left" >
<td class="style1" style="border:1px solid #996666;">
<table border="0" cellpadding="0" cellspacing="3" class="style1">
<tr>
<td><p><font color="#666666">人気壁面収納家具「ニューフラット」の製造メーカーが、<br />
  これまでの壁面収納家具ユーザーからのご意見を取り入れ、開発した2010年新シリーズ</font><font color="#666666">「ライフ」シリーズの登場です。<br />
  <br />
    【ニューフラットシリーズとの大きな違い】<br />
  <br />
  </font><font color="#666666">・「幅39cm」ユニットの追加で選択の幅がひろがり、より壁面横幅においてもピッタリ設置が可能になりました。<br />
    また、これまで要望の高かった「小型のTV台」として57.5cmTV台をラインナップ。</font></p>
  <p><font color="#666666"></font><font color="#666666">・TV台のフラップ部分はアルミ枠と、スモークガラスで精悍な顔つきに。表面材も人気の「スーパーホワイト」はフラットから継承していますが、ナチュラル色をツヤあり→ツヤ消し木目に変更。<br />
    ブラウン系は最近の流行でもある「ツヤ消しウォールナット色」を採用して、スタイリッシュに変身を遂げています。<br />
  <br />
  <br /><img src="https://image.rakuten.co.jp/i-office1/cabinet/chiba5/lifecolors.jpg" alt=""   border="0" >
  <br />
  <br />
    ・壁面収納家具は一度設置してしまうと動かすのは容易ではありません。本体横の配線孔を利用して本体内部での配線の取り回し、配線追加が劇的に楽になりました。</font></p>
  <p><font color="#666666">・ニューフラットにおいて要望が高かった「本格デスク」をシリーズに追加しました。<br />
    ミラーの付いた「飾り棚」も新たにラインアップ。<br />
  <br />
  </font></p>
  <h4><br />
    </h4>
  </td>
</tr>
<tr>
<td bgcolor="#f5deb3" style="border:1px dotted #996666; padding:5px;"><table width="95% cellpadding="0" cellspacing="0">
  <tr>
    <td width="95%" align="left" valign="center" class="style1">【本体サイズ】こちらの図面を参照ください</td>
