    <td align="left" class="style1"><br /></td>
  </tr>
  <tr>
    <td align="left" class="style1">【材質】<span class="style3">前扉　ホワイト→化粧合板（熱硬化樹脂形成シート張り）　　ナチュラル・ウォールナット→化粧合板（オレフィンシート張り）　本体→化粧合板　</span></td>
    </tr>
  <tr>
    <td align="left" class="style1">【生産国】日本製　低ホルムアルデヒド　F☆☆☆☆（最上位ランク）</td>
    </tr>
</table></td>
</tr>
<tr>
<td bgcolor="#FFFFFF" class="style1" style="border:1px dotted #996666; padding:5px;"><font color="#73001B">・本体、上置きは完成品でのお届けです。</font><font color="#666666"><br />
</font><br />
<font color="#73001B">・商品は玄関先までのお届けとなります。本体と上置きの結合設置、商品の横連結はお客様での作業となります。</font><br />
<br />
<font color="#666666">・本体は高さ180cmの大型になりますので、設置には2名以上が必要です。</font><br />
<font color="#666666"><br />
</font><font color="#666666">・畳やカーペットの上への設置は適しておりません。<br />
<br />
・お手持ちの電化製品にあわせて、本体内に引き込むための延長コードやアンテナコードをご準備ください。<br />
</font></td>
</tr>
